import React from "react";

const Button = ({ background, color, onClick, text }) => {
  return (
    <>
      <div
        style={{ backgroundColor: { background }, color: { color } }}
        onClick={onClick}
      >
        {text}
      </div>
    </>
  );
};

export default Button;
